import React from "react";

const TodoItem = ({ todo }) => {
  return (
    <tr>
      <td>{todo.id}</td>
      <td>{todo.title}</td>
      <td>{todo.text}</td>
      <td>{todo.project}</td>
      <td>{todo.isActive.toString()}</td>
      <td>{todo.dateCreated.toLocaleString()}</td>
      <td>{todo.dateModified.toLocaleString()}</td>
    </tr>
  );
};
const TodoList = ({ todos }) => {
  return (
    <table className="table table-bordered">
      <thead>
        <tr>
          <th>ID</th>
          <th>Title</th>
          <th>Text</th>
          <th>Project</th>
          <th>Is Active?</th>
          <th>Date Created</th>
          <th>Date Modified</th>
        </tr>
      </thead>
      <tbody>
        {todos.map((todo) => (
          <TodoItem todo={todo} key={todo.id.toString()} />
        ))}
      </tbody>
    </table>
  );
};
export default TodoList;
